    // âœ… Step 7.2: Find the trailer ID based on the name
    for (let trailerKey in trailers) {
        if (trailers[trailerKey].n === trailer_name.trim()) {
            trailerId = trailers[trailerKey].id;
            break;
        }
    }

    if (!trailerId) {
        console.warn(`âš ï¸ WARNING: Trailer '${trailer_name}' not found!`);
        continue;
    }

    // âœ… Step 7.3: Find the current group of the trailer
    for (let groupId in trailerGroups) {
        let group = trailerGroups[groupId];
        if (group.drs && group.drs.includes(trailerId)) {
            currentGroupId = groupId;
            break;
        }
    }

    // âœ… Step 7.4: Find the new group ID based on the name
    let newGroupId = null;
    for (let groupId in trailerGroups) {
        if (trailerGroups[groupId].n === new_group_name.trim()) {
            newGroupId = groupId;
            break;
        }
    }

    // âœ… Step 7.5: If new_group_id is not found, set it to null
    if (!newGroupId) {
        console.warn(`âš ï¸ WARNING: Destination group '${new_group_name}' not found! Setting new_group_id as null.`);
        newGroupId = null;
    }

    // âœ… Step 7.6: Add to the move list
